//doc.rust-lang.org/1.88.0/core/clone/trait.Clone.html#tymethod.clone\" class=\"fn\">clone</a>(&amp;self) -&gt; <a class=\"enum\" href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html\" title=\"enum yet_another_parachain_runtime::frame_support::sp_runtime::Cow\">Cow</a>&lt;'_, B&gt;</h4></section></summary><div class='docblock'>Returns a copy of the value. <a href=\"https://doc.rust-lang.org/1.88.0/core/clone/trait.Clone.html#tymethod.clone\">Read more</a></div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.clone_from\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#204\">Source</a><a href=\"#method.clone_from\" class=\"anchor\">ยง</a><h4 class=\"code-header\">fn <a href=\"https://doc.rust-lang.org/1.88.0/core/clone/trait.Clone.html#method.clone_from\" class=\"fn\">clone_from</a>(&amp;mut self, source: &amp;<a class=\"enum\" href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html\" title=\"enum yet_another_parachain_runtime::frame_support::sp_runtime::Cow\">Cow</a>&lt;'_, B&gt;)</h4></section></summary><div class='docblock'>Performs copy-assignment from <code>source</code>. <a href=\"https://doc.rust-lang.org/1.88.0/core/clone/trait.Clone.html#method.clone_from\">Read more</a></div></details></div></details>","Clone","yet_another_parachain_runtime::polkadot_sdk_frame::deps::sp_version::ApisVec"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-Cow%3C'_,+B%3E\" class=\"impl\"><a class=\"src rightside\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#212\">Source</a><a href=\"#impl-Cow%3C'_,+B%3E\" class=\"anchor\">ยง</a><h3 class=\"code-header\">impl&lt;B&gt; <a class=\"enum\" href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html\" title=\"enum yet_another_parachain_runtime::frame_support::sp_runtime::Cow\">Cow</a>&lt;'_, B&gt;<div class=\"where\">where\n    B: <a class=\"trait\" href=\"https://doc.rust-lang.org/1.88.0/alloc/borrow/trait.ToOwned.html\" title=\"trait alloc::borrow::ToOwned\">ToOwned</a> + ?<a class=\"trait\" href=\"https://doc.rust-lang.org/1.88.0/core/marker/trait.Sized.html\" title=\"trait core::marker::Sized\">Sized</a>,</div></h3></section></summary><div class=\"impl-items\"><details class=\"toggle method-toggle\" open><summary><section id=\"method.is_borrowed\" class=\"method\"><a class=\"src rightside\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#228\">Source</a><h4 class=\"code-header\">pub const fn <a href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html#tymethod.is_borrowed\" class=\"fn\">is_borrowed</a>(&amp;self) -&gt; <a class=\"primitive\" href=\"https://doc.rust-lang.org/1.88.0/std/primitive.bool.html\">bool</a></h4></section><span class=\"item-info\"><div class=\"stab unstable\"><span class=\"emoji\">๐ฌ</span><span>This is a nightly-only experimental API. (<code>cow_is_borrowed</code>)</span></div></span></summary><div class=\"docblock\"><p>Returns true if the data is borrowed, i.e. if <code>to_mut</code> would require additional work.</p>\n<h5 id=\"examples\"><a class=\"doc-anchor\" href=\"#examples\">ยง</a>Examples</h5>\n<div class=\"example-wrap\"><pre class=\"rust rust-example-rendered\"><code><span class=\"attr\">#![feature(cow_is_borrowed)]\n</span><span class=\"kw\">use </span>std::borrow::Cow;\n\n<span class=\"kw\">let </span>cow = Cow::Borrowed(<span class=\"string\">\"moo\"</span>);\n<span class=\"macro\">assert!</span>(cow.is_borrowed());\n\n<span class=\"kw\">let </span>bull: Cow&lt;<span class=\"lifetime\">'_</span>, str&gt; = Cow::Owned(<span class=\"string\">\"...moo?\"</span>.to_string());\n<span class=\"macro\">assert!</span>(!bull.is_borrowed());</code></pre></div>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.is_owned\" class=\"method\"><a class=\"src rightside\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#250\">Source</a><h4 class=\"code-header\">pub const fn <a href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html#tymethod.is_owned\" class=\"fn\">is_owned</a>(&amp;self) -&gt; <a class=\"primitive\" href=\"https://doc.rust-lang.org/1.88.0/std/primitive.bool.html\">bool</a></h4></section><span class=\"item-info\"><div class=\"stab unstable\"><span class=\"emoji\">๐ฌ</span><span>This is a nightly-only experimental API. (<code>cow_is_borrowed</code>)</span></div></span></summary><div class=\"docblock\"><p>Returns true if the data is owned, i.e. if <code>to_mut</code> would be a no-op.</p>\n<h5 id=\"examples-1\"><a class=\"doc-anchor\" href=\"#examples-1\">ยง</a>Examples</h5>\n<div class=\"example-wrap\"><pre class=\"rust rust-example-rendered\"><code><span class=\"attr\">#![feature(cow_is_borrowed)]\n</span><span class=\"kw\">use </span>std::borrow::Cow;\n\n<span class=\"kw\">let </span>cow: Cow&lt;<span class=\"lifetime\">'_</span>, str&gt; = Cow::Owned(<span class=\"string\">\"moo\"</span>.to_string());\n<span class=\"macro\">assert!</span>(cow.is_owned());\n\n<span class=\"kw\">let </span>bull = Cow::Borrowed(<span class=\"string\">\"...moo?\"</span>);\n<span class=\"macro\">assert!</span>(!bull.is_owned());</code></pre></div>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.to_mut\" class=\"method\"><span class=\"rightside\"><span class=\"since\" title=\"Stable since Rust version 1.0.0\">1.0.0</span> ยท <a class=\"src\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#272\">Source</a></span><h4 class=\"code-header\">pub fn <a href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html#tymethod.to_mut\" class=\"fn\">to_mut</a>(&amp;mut self) -&gt; &amp;mut &lt;B as <a class=\"trait\" href=\"https://doc.rust-lang.org/1.88.0/alloc/borrow/trait.ToOwned.html\" title=\"trait alloc::borrow::ToOwned\">ToOwned</a>&gt;::<a class=\"associatedtype\" href=\"https://doc.rust-lang.org/1.88.0/alloc/borrow/trait.ToOwned.html#associatedtype.Owned\" title=\"type alloc::borrow::ToOwned::Owned\">Owned</a></h4></section></summary><div class=\"docblock\"><p>Acquires a mutable reference to the owned form of the data.</p>\n<p>Clones the data if it is not already owned.</p>\n<h5 id=\"examples-2\"><a class=\"doc-anchor\" href=\"#examples-2\">ยง</a>Examples</h5>\n<div class=\"example-wrap\"><pre class=\"rust rust-example-rendered\"><code><span class=\"kw\">use </span>std::borrow::Cow;\n\n<span class=\"kw\">let </span><span class=\"kw-2\">mut </span>cow = Cow::Borrowed(<span class=\"string\">\"foo\"</span>);\ncow.to_mut().make_ascii_uppercase();\n\n<span class=\"macro\">assert_eq!</span>(\n  cow,\n  Cow::Owned(String::from(<span class=\"string\">\"FOO\"</span>)) <span class=\"kw\">as </span>Cow&lt;<span class=\"lifetime\">'_</span>, str&gt;\n);</code></pre></div>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.into_owned\" class=\"method\"><span class=\"rightside\"><span class=\"since\" title=\"Stable since Rust version 1.0.0\">1.0.0</span> ยท <a class=\"src\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#320\">Source</a></span><h4 class=\"code-header\">pub fn <a href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html#tymethod.into_owned\" class=\"fn\">into_owned</a>(self) -&gt; &lt;B as <a class=\"trait\" href=\"https://doc.rust-lang.org/1.88.0/alloc/borrow/trait.ToOwned.html\" title=\"trait alloc::borrow::ToOwned\">ToOwned</a>&gt;::<a class=\"associatedtype\" href=\"https://doc.rust-lang.org/1.88.0/alloc/borrow/trait.ToOwned.html#associatedtype.Owned\" title=\"type alloc::borrow::ToOwned::Owned\">Owned</a></h4></section></summary><div class=\"docblock\"><p>Extracts the owned data.</p>\n<p>Clones the data if it is not already owned.</p>\n<h5 id=\"examples-3\"><a class=\"doc-anchor\" href=\"#examples-3\">ยง</a>Examples</h5>\n<p>Calling <code>into_owned</code> on a <code>Cow::Borrowed</code> returns a clone of the borrowed data:</p>\n\n<div class=\"example-wrap\"><pre class=\"rust rust-example-rendered\"><code><span class=\"kw\">use </span>std::borrow::Cow;\n\n<span class=\"kw\">let </span>s = <span class=\"string\">\"Hello world!\"</span>;\n<span class=\"kw\">let </span>cow = Cow::Borrowed(s);\n\n<span class=\"macro\">assert_eq!</span>(\n  cow.into_owned(),\n  String::from(s)\n);</code></pre></div>\n<p>Calling <code>into_owned</code> on a <code>Cow::Owned</code> returns the owned data. The data is moved out of the\n<code>Cow</code> without being cloned.</p>\n\n<div class=\"example-wrap\"><pre class=\"rust rust-example-rendered\"><code><span class=\"kw\">use </span>std::borrow::Cow;\n\n<span class=\"kw\">let </span>s = <span class=\"string\">\"Hello world!\"</span>;\n<span class=\"kw\">let </span>cow: Cow&lt;<span class=\"lifetime\">'_</span>, str&gt; = Cow::Owned(String::from(s));\n\n<span class=\"macro\">assert_eq!</span>(\n  cow.into_owned(),\n  String::from(s)\n);</code></pre></div>\n</div></details></div></details>",0,"yet_another_parachain_runtime::polkadot_sdk_frame::deps::sp_version::ApisVec"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-Debug-for-Cow%3C'_,+B%3E\" class=\"impl\"><span class=\"rightside\"><span class=\"since\" title=\"Stable since Rust version 1.0.0\">1.0.0</span> ยท <a class=\"src\" href=\"https://doc.rust-lang.org/1.88.0/src/alloc/borrow.rs.html#394-396\">Source</a></span><a href=\"#impl-Debug-for-Cow%3C'_,+B%3E\" class=\"anchor\">ยง</a><h3 class=\"code-header\">impl&lt;B&gt; <a class=\"trait\" href=\"yet_another_parachain_runtime/emulated_integration_tests_common/xcm_emulator/trait.Debug.html\" title=\"trait yet_another_parachain_runtime::emulated_integration_tests_common::xcm_emulator::Debug\">Debug</a> for <a class=\"enum\" href=\"yet_another_parachain_runtime/frame_support/sp_runtime/enum.Cow.html\" title=\"enum yet